webpackJsonp([20033109664004],{5568:function(e,t){e.exports={data:{post:{html:'<p>We\'ve now back in Germany after 2-1/2 weeks in Las Vegas and Phoenix. Of course Christopher weathered the flight much better than we did. And I just realized that funny smell and feeling in our house is non-air-condiditioned air.</p>\n<p>I need to catch up on news, especially what Adam Curry has to say about <a href="http://live.curry.com/stories/2002/05/08/theBigLie.html">the big lie</a> about the death of Pim Fortuyn.</p>\n<p>I see it\'s also time to update <a href="http://www.movabletype.org/">Moveable Type</a></p>',fields:{title:"We're Back",date:"09 May 2002",url:"https://papascott.de/2002-05-09-were-back/"}}},pathContext:{slug:"/2002-05-09-were-back/",prev:{fields:{title:"Update From The Desert",date:"02 May 2002",slug:"/2002-05-02-update-from-the-desert/"}},next:{fields:{title:"Feeling Less Safe",date:"10 May 2002",slug:"/2002-05-10-feeling-less-safe/"}}}}}});
